import React from 'react';
import './SkillsShowcase.css';

const skills = [
  { name: 'React', proficiency: 90 },
  { name: 'Node.js', proficiency: 85 },
  { name: 'MongoDB', proficiency: 80 },
  { name: 'Express', proficiency: 80 },
  { name: 'JavaScript', proficiency: 90 },
  { name: 'HTML/CSS', proficiency: 95 },
  { name: 'Python', proficiency: 70 },
  { name: 'Django', proficiency: 70 },
  { name: 'SQL', proficiency: 75 },
  { name: 'Git', proficiency: 85 },
  { name: 'AWS', proficiency: 75 },
  { name: 'Docker', proficiency: 70 },
  { name: 'Kubernetes', proficiency: 60 },
  { name: 'CI/CD', proficiency: 65 },
  { name: 'Agile', proficiency: 80 },
  { name: 'Scrum', proficiency: 80 },
  { name: 'Kanban', proficiency: 75 },
  // Add more skills
];

const SkillsShowcase = () => {
  return (
    <div className="skills-showcase">
      {skills.map((skill, index) => (
        <div key={index} className="skill-bar" data-aos="fade-up">
          <span className="skill-name">{skill.name}</span>
          <div className="progress-bar">
            <div
              className="progress-fill"
              style={{ width: `${skill.proficiency}%` }}
            ></div>
          </div>
        </div>
      ))}
    </div>
  );
};

export default SkillsShowcase;
